import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the 'My Events' link to be visible and click it
    await page.waitForSelector('a.nav-link[href="dashboard.html"]', { state: 'visible' });
    await page.click('a.nav-link[href="dashboard.html"]');

    // Wait for the dashboard page to load
    await page.waitForLoadState('networkidle');

    // Take screenshot after navigating to 'My Events'
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_my_events.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_my_events.png'));

    // Verify that we are on the 'My Events' page
    const isOnMyEventsPage = await page.url() === 'dashboard.html';

    return {
      success: true,
      action: "Navigated to 'My Events' page successfully",
      extractedData: { isOnMyEventsPage },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
